    /* harmony default export */
    __webpack_exports__["default"] = "<h1>Home Of MartinLayooInc's <em>Handy Man Site</em></h1>\r\n<p>This is the point you will discover the true user journeys of a Fundi (Handy-Man) &amp; Client initiate and conclude work through contract leverage, with rewards and benefits for both as well as contribute toward a global <i>Gig Market Economy</i></p>\r\n<p>\r\n  MartinLayooInc &copy; have built a truly ingenius Web product, that all Handy Men and their clients will need to accomplish gross work delivery, through iterative procedures.\r\n</p>\r\n<p>\r\n  <img src=\"/assets/images/CarMechanic.jpg\" alt=\"Car Mechanic\" style=\"width:100% !important; height:auto !important\" />\r\n</p>\r\n<p>\r\n  Within each procedure are steps that have been taken to make this application versertile and secure; as per MartinLayooInc Security concerns - where high end encryption, is used to secure User Journeys to fulfill the result Fundis, Clients, and Government Bodies in the Industry need. Security emboldened by 15 years in the Industry, allowing each contractual obligation to be met and relied upon, to accomplish each objective with no fear of data breaches.\r\n</p>\r\n<p>\r\n  <img src=\"/assets/images/carpentryMetalwork.jpg\" alt=\"Lady Carpenter\" style=\"width:100% !important; height:auto !important\" />\r\n</p>\r\n<p>To help you get started, we've also set up:</p>\r\n<ul>\r\n  <li>Each participating Actor (Individual Accounts) under roles, to ensure a party engages securely to completion of a transaction from inception to delivery.</li>\r\n  <li>Development that sees spectrum to spectrum the actual coherent progress of Transactions, as well as ensuring through lengthy study of the Fundi Man markets involved - pertaining to Africa as a geo land mass - allowing provisions of a seamless and amicable journey for both parties.</li>\r\n  <li>The use of Secure Database structure refined with each category or entities that make universal activities of 3rd Parties flexible, and transparent, enhanced by rich Single Page Frameworks in cutting edge technology.</li>\r\n  <li>Leveraging facilities for real time reporting using Charts, drawn seamlessly depicting contractual plateaus, and hikes over seasons, to units in days and months - flexibly geared toward the Client's certainity in exhalting work completion, within deadlines set.</li>\r\n</ul>\r\n<p>Come and join the transition of Fundi/Client work acquisition as you partner with the right skilled fundis local to you, elevating the peak of success like never before.</p>\r\n<p>With every partner, depending on role you need to achieve your bargain in the market, you can register on the site to set up an account. Breathe easily as you step into the hazard free environment with the right tools. Click on the register menu and initiate your golden journey, coming of age with computing power.</p>\r\n";

